# Fungsi Haversine untuk menghitung jarak antar 2 koordinat
import math

def haversine(lat1, lon1, lat2, lon2):
    R = 6371  # radius bumi dalam kilometer
    phi1, phi2 = math.radians(lat1), math.radians(lat2)
    dphi = math.radians(lat2 - lat1)
    dlambda = math.radians(lon2 - lon1)
    a = math.sin(dphi/2)**2 + math.cos(phi1)*math.cos(phi2)*math.sin(dlambda/2)**2
    return R * (2 * math.atan2(math.sqrt(a), math.sqrt(1 - a)))

# Ambil hanya kolom yang dibutuhkan
locations = df[['Nama Tempat Wisata', 'Latitude', 'Longitude']].dropna().reset_index(drop=True)
n = len(locations)

# Buat matriks jarak antar tempat wisata
distance_matrix = [[0]*n for _ in range(n)]
for i in range(n):
    for j in range(n):
        if i != j:
            distance_matrix[i][j] = haversine(
                locations.loc[i, 'Latitude'], locations.loc[i, 'Longitude'],
                locations.loc[j, 'Latitude'], locations.loc[j, 'Longitude']
            )

# Brute Force TSP
import itertools

min_distance = float('inf')
best_route = []

for perm in itertools.permutations(range(1, n)):  # permutasi, kecuali node 0
    route = [0] + list(perm) + [0]
    dist = sum(distance_matrix[route[i]][route[i+1]] for i in range(n))
    if dist < min_distance:
        min_distance = dist
        best_route = route

# Tampilkan rute terbaik
best_places = [locations.loc[i, 'Nama Tempat Wisata'] for i in best_route]
print("\n🔍 Rute terbaik (optimal):")
print(" -> ".join(best_places))
print(f"\n📏 Total Jarak: {min_distance:.2f} km")

