# Fungsi login sederhana
def login(username, password):
    correct_username = "percobaan"
    correct_password = "091102"
    return username == correct_username and password == correct_password

# Fungsi brute force login
def brute_force_login():
    target_username = "percobaan"
    attempts = 0

    for i in range(100000):  # dari 0000 sampai 9999
        guess_password = str(i).zfill(6)  # Mengubah ke format 4 digit, contoh: 0007
        attempts += 1

        if login(target_username, guess_password):
            print(f"✅ Password ditemukan: {guess_password}")
            print(f"🔁 Jumlah percobaan: {attempts}")
            return

        if i % 500 == 0:
            print(f"Masih mencoba... saat ini: {guess_password}")

    print("❌ Password tidak ditemukan dalam rentang 0000–9999.")

# Jalankan brute force
