"""**Study Kasus III :**

Mensimulasikan sebuah sistem login yang memiliki beberapa akun
"""

# Daftar akun asli (simulasi database)
accounts = {
    "Iqbal": "091102",
    "Naufal": "090205",
    "usertest": "112233",
}

# Fungsi login (simulasi server)
def login(username, password):
    return accounts.get(username) == password

# Brute force terhadap banyak username
def brute_force_multi_user():
    from time import time
    start_time = time()
    total_attempts = 0

    for username in accounts.keys():
        print(f"\n🚀 Mencoba username: {username}")
        found = False
        for i in range(1000000):  # Coba 6 digit angka dari 000000 sampai 999999
            guess = str(i).zfill(6)
            total_attempts += 1

            if login(username, guess):
                print(f"✅ Username: {username} | Password ditemukan: {guess}")
                print(f"🔁 Percobaan: {i+1}")
                found = True
                break

            if i % 50000 == 0:
                print(f"⏳ Masih mencoba... {guess}")

        if not found:
            print(f"❌ Password untuk {username} tidak ditemukan (hanya angka 6 digit yang diuji)")

    end_time = time()
    print(f"\n🕒 Total waktu: {end_time - start_time:.2f} detik")
    print(f"🔁 Total percobaan semua akun: {total_attempts}")

# Jalankan brute force
brute_force_multi_user()

